import React from "react";

function Career() {
  return (
    <div>
      <video className="h-full w-full rounded-lg" loop muted autoPlay controls>
        <source
          src="https://images.pexels.com/videos/5981901/adult-business-business-woman-career-5981901.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=2"
          type="video/mp4"
        />
        Your browser does not support the video tag.
      </video>
    </div>
  );
}

export default Career;
